import React from 'react';
import CardsData from './CardsData';
import App from './App';

function a(){

<div className="container-fluid">
      <div className="row">
        {CardsData.map(cData)}
      </div>
  </div>

}


// cards attribute data 
function cData(val){
    return(
    <>
            <div className="col-xl-3 col-lg-3 col-sm-6 col-xs-12">
              <App image={val.image} title={val.title}/>
            </div>
    </>
    );
    }


export default a;
